import './App.css';

const particlesOptions = {

  particles: {
    number:{
      value:30,
      density:{
        enable:true,
        vaue_area:800
      }
    }
    }
  }





class App extends Component {
  render(){
    return(
    <div className="App">
       <Particles className = 'particles' 
              params={particlesOptions}
            />
    <Navigation/>
     <Logo/>
     <Rank/>
     <ImageLinkForm/>

    {/*<FaceRecognition/> */}

    </div>
  );
}
}

export default App;
